import React, { useState } from 'react';

function Header() {
  const [searchQuery, setSearchQuery] = useState('');
  const [searchResults, setSearchResults] = useState([]);

  // Función para manejar cambios en el input de búsqueda
  const handleSearchChange = (event) => {
    setSearchQuery(event.target.value);
  };

  // Función para manejar la búsqueda
  const handleSearch = () => {
    // Realizar una solicitud HTTP para obtener los proyectos del backend
    fetch(`http://tuapi.com/proyectos?nombre=${searchQuery}`)
      .then((response) => response.json())
      .then((data) => {
        setSearchResults(data);
      })
      .catch((error) => {
        console.error('Error al buscar proyectos:', error);
      });
  };

  return (
    <nav className="navbar bg-base-100 shadow-lg fixed top-0 left-1 right-1">
      <div className="container mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16">
          {/* Logo */}
          <div className="flex-shrink-0 flex items-center">
            <a href="/login">
              <img
                className="h-12 w-15 rounded-full"
                src="https://raw.githubusercontent.com/raulgonca/Front_stafko/main/src/Image/Logito.svg"
                alt="Logo"
              />
            </a>
          </div>
          {/* Search */}
          <div className="flex-1 flex justify-center px-2 lg:ml-6 lg:justify-end">
            <div className="relative w-full max-w-lg">
              <label htmlFor="search" className="sr-only">
                Search
              </label>
              <div className="relative">
                <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
                  <svg
                    className="h-5 w-5"
                    fill="currentColor"
                    viewBox="0 0 20 20"
                  >
                    <path
                      fillRule="evenodd"
                      d="M13.293 14.707a1 1 0 0 1-1.414 1.414l-3-3a1 1 0 1 1 1.414-1.414l3 3zM15 9a6 6 0 1 1-12 0 6 6 0 0 1 12 0z"
                      clipRule="evenodd"
                    />
                  </svg>
                  <div className="relative">
                    <input
                      id="search"
                      className="block w-full bg-gray-900 focus:outline-none text-gray-100 placeholder-gray-400 rounded-md py-2 pl-10 pr-3 sm:text-sm"
                      style={{ backgroundColor: 'rgba(0, 0, 0, 0.3)' }}
                      placeholder="Search"
                      type="text"
                      value={searchQuery}
                      onChange={handleSearchChange}
                    />
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </nav>
  );
}

export default Header;
